result_comment:
Отказ после технического интервью с заказчиком (Альфа-Банк РФ): 
Когда не знает, начинает придумывать и выкручиваться; 
Отвечает вопросом на вопрос (не уточняющие вопросы). Вот это вообще не понравилось; 
Не прозрачная мотивация; 
Сейчас проходит теорию; 
Но отказ по технике

Ответ клиента: не готов взять Дарью в команду. Причины:
Плюсы Дарьи:- знает английский(b2) и русский;- есть опыт в б2б;- есть опыт работы в команде;- есть желание учится;
Чего не хватает Дарьи для присоединения в нашу команду:- Мы ищем крепкого продуктового дизайнера, который может генерировать задачу и очень самостоятельный. Кажется Дарье нужен будет лид, который будет ее направлять;- Не увидел в презентации хорошего анализа, процесс генерирует идеи и как она валидировали идеи;- Не мало важным фактором является, умение рисовать красивый UI. В ее работах этого я не нашел.

Комментарий клиента:
Никита очень хороший дизайнер. Но это не тот дизайн который мы ищем в команду.
Что понравился:
- Человек открытый;
- Имеет хороший вкус;
- Отлично рисует UI;
По каким критериям не подходит:
- Не хватает опыта проведения исследований. 
- Не увидел, как Никита принимал свой дизайн от разработчиков. 
- Многое то что нарисовал Никита кажется концепт дизайнами, кажется Никита хорошо не знаком с дизайн системами Google и Apple;
- Дизайн Никиты нарисован не для конечных клиентов.
- Не увидел хорошие скиллы по дизайн системе.
